var dimensions = [
  {name:             "Jogador", format:     formatDefault},  
  {name:                "Time", format:     formatDefault},  
  {name:            "esperado", format:    formatNumber, scale: mediaScale},  
  {name:     "preco_cartoleta", format:    formatNumber, scale: precoScale},
  {name:  "esperado_cartoleta", format:    formatNumber, scale: esp_preco_Scale},
  {name:     "esperado_desvio", format:    formatNumber, scale: esp_desvio_Scale},
  {name:  "variacao_cartoleta", format:    formatNumber, scale: valorizacao_Scale}
];

dimensions.forEach(function(dimension, i) {
  dimension.index = i;
});


var row = d3.select("#g-chart").selectAll(".g-row")
    .data(posicao)
  .enter().append("g")
    .attr("class", "g-row")
    .classed("g-special", function(pos) { return pos === media_selecao; })
    .attr("transform", function(pos, i) { return "translate(0," + i * 21 + ")"; });

row.append("rect")
    .attr("class", "g-background")
    .attr("width", "100%")
    .attr("height", 20);

row.each(function(pos) {
  var cell = d3.select(this).selectAll(".g-cell")
      .data(dimensions)
    .enter().append("g")
      .attr("class", "g-cell")
      .classed("g-quantitative", function(dimension) { return dimension.scale; })
      .attr("transform", function(dimension, i) { return "translate(" + i * 160 + ")"; });

  var quantitativeCell = cell.filter(function(dimension) { return dimension.scale && !isNaN(pos[dimension.name]); });

  quantitativeCell.append("rect")
      .attr("class", "g-bar")
      .attr("width", function(dimension) { return dimension.scale(Math.min(media_selecao[dimension.name], pos[dimension.name])); })
      .attr("height", 20);

  quantitativeCell.filter(function(dimension) { return +pos[dimension.name] > +media_selecao[dimension.name]; }).append("rect")
      .attr("class", "g-bar-cap")
      .attr("x", function(dimension) { return dimension.scale(media_selecao[dimension.name]); })
      .attr("width", function(dimension) { return dimension.scale(pos[dimension.name] - media_selecao[dimension.name]); })
      .attr("height", 20);

  cell.append("text")
      .attr("class", "g-value")
      .attr("x", function(dimension) { return dimension.scale ? 3 : 0; })
      .attr("y", function(dimension) { return dimension.categorical ? 9 : 10; })
      .attr("dy", ".35em")
      .text(function(dimension) { return dimension.format(pos[dimension.name]); })
      .attr("clip-path", function(dimension) { return (dimension.clipped = this.getComputedTextLength() > 140) ? "url(#g-clip-cell)" : null; });

  cell.filter(function(dimension) { return dimension.clipped; }).append("rect")
      .style("fill", "url(#g-clip-gradient)")
      .attr("x", 136)
      .attr("width", 20)
      .attr("height", 20);
});

d3.select("#g-chart").selectAll(".g-compare")
    .data(dimensions.filter(function(dimension) { return dimension.scale; }))
  .enter().append("line")
    .attr("class", "g-compare")
    .attr("transform", function(dimension) { return "translate(" + (dimension.scale(media_selecao[dimension.name]) + dimension.index * 160) + ",0)"; })
    .attr("y2", "100%");

d3.selectAll(".g-body .g-subtitle")
    .data(dimensions)
    .on("click", sort);


function sort(dimension) {
  var dimensionName = dimension.name,
      descending = d3.select(this).classed("g-ascending");

  console.log(dimensionName);

  d3.selectAll(".g-descending").classed("g-descending", false);
  d3.selectAll(".g-ascending").classed("g-ascending", false);

  if (descending) {
    d3.select(this).classed("g-descending", true);
    var orderQuantitative = function(a, b) {
      console.log(a);
      console.log(b);
      return ((b === media_selecao) - (a === media_selecao))
          || (isNaN(a[dimensionName]) - isNaN(b[dimensionName]))
          || (a[dimensionName] - b[dimensionName])
          || (a.index - b.index);
          
    };

    var orderName = function(a, b) {
      
      if (dimensionName === "Jogador") {
          return ((b === media_selecao) - (a === media_selecao))
              || b.Jogador.localeCompare(a.Jogador);
        } else {
          return ((b === media_selecao) - (a === media_selecao))
              || d3.descending(a.Time, b.Time);
        }
      };
  } else {
    d3.select(this).classed("g-ascending", true);

    var orderQuantitative = function(a, b) {
      return ((b === media_selecao) - (a === media_selecao))
          || (isNaN(a[dimensionName]) - isNaN(b[dimensionName]))
          || (b[dimensionName] - a[dimensionName])
          || (a.index - b.index);
    };

    var orderName = function(a, b) {
        
        if (dimensionName === "Jogador") {
          return ((b === media_selecao) - (a === media_selecao))
              || a.Jogador.localeCompare(b.Jogador);
        } else {
          return ((b === media_selecao) - (a === media_selecao))
              || d3.ascending(a.Time, b.Time);
        }
      };
  }

  d3.selectAll(".g-row")
      .sort((dimensionName === "Jogador" || dimensionName === "Time") ? orderName : orderQuantitative)
      .each(function(pos, i) { pos.index = i; })
    .transition()
      .delay(function(pos, i) { return (i - 1) * 10; })
      .duration(750)
      .attr("transform", function(pos, i) { return "translate(0," + i * 21 + ")"; });
}

